import '../components/Media_con.css';
import React from 'react';
import sampleSong from '../assets/media/Videos/sample_song.3gp';

function Media_con() {
    return (
        <div className='media_container'>
            <div className='media_content'>
                <h2>See the Alteryx AI<br /> Platform in Action</h2>
                <p>See how Alteryx uses AI for smarter, data-driven decision making.</p>
                <button>Learn More</button>
                <button>Start Free Trial</button>
            </div>

            <div className='media_video'>
                <video width="600" controls>
                    <source src={sampleSong} type="video/3gp" />
                </video>
            </div>
        </div>
    );
}

export default Media_con;
